    /******************************************** CATCH THE CHANGES IN CLINICFORM************************************/
    ManageClinicComponent.prototype.onclinicFormValuesChanged = function () {
        this.error = "";
        this.errMessage = '';
        for (var field in this.clinicFormErrors) {
            if (!this.clinicFormErrors.hasOwnProperty(field)) {
                continue;
            }
            // Clear previous errors
            this.clinicFormErrors[field] = {};
            // Get the control
            var control = this.clinicForm.get(field);
            if (control && control.dirty && !control.valid) {
                this.clinicFormErrors[field] = control.errors;
            }
        }
    };
